import React from "react";

const Footer = () => {
  return (
    <div className="mainFooter">
      <div className="footercontent">
        <div className="links">
          <span>
            <a href="https://example.com">
              Git<i class="fas fa-arrow-right"></i>
            </a>
          </span>
        </div>
        <div className="copyright"></div>
      </div>
    </div>
  );
};

export default Footer;
